import { ActionTypes } from "../constants/constants";
import axios from "axios";

export function setData() {
  let url = "http://localhost:8080/device_summary";
  let headers = {
    token: localStorage.getItem("token")
  };
  axios.get(url,{headers})
  .then()
}
